$(document).ready(function () {

  let swiper = new Swiper(".feedbacks__slider", {
    slidesPerView: 1,
    spaceBetween: 20,
    centeredSlides: true,
    loop: true,
    pagination: {
      el: ".swiper-pagination",
      clickable: true,
    },
    effect: "coverflow",
    coverflowEffect: {
      rotate: 0,
      stretch: 0,
      depth: 0,
      modifier: 0,
      slideShadows: false
    },
    breakpoints: {
      500: {
        slidesPerView: 2,
        spaceBetween: 20,
        centeredSlides: false
      },
      768: {
        slidesPerView: 3,
        spaceBetween: 20,
      },
      1160: {
        slidesPerView: 4,
        spaceBetween: 30,
      },
    }
  });

  $('.header__burger').click(function () {
    $('body').toggleClass('is-open-menu');
  });


  // tabs
  $('.cabinet__tabs-button, .cabinet__settings-tabs-button').click(function () {
    var openEl = $('.' + $(this).data('open'));

    $(openEl).siblings().removeClass('is-open');
    $(this).siblings().removeClass('is-open');
    $(this).addClass('is-open');
    $(openEl).addClass('is-open');

  });

  // accordion
  (function () {
    var initAccordion = function (itemsClass, headerClass, bodyClass) {
      var $items = $(itemsClass);

      $items.find(headerClass).on('click', function () {
        $item = $(this).parent();
        $items.not($item).removeClass('is-open');
        $items.not($item).find(headerClass).removeClass('is-open');
        $items.not($item).find(bodyClass).slideUp(300);


        if ($(this).hasClass('is-open')) {
          $item.removeClass('is-open');
          $(this).removeClass('is-open');
          $(this).siblings(bodyClass).slideUp(300);

        } else {
          $item.addClass('is-open');
          $(this).addClass('is-open');
          $(this).siblings(bodyClass).slideDown(300);

        }
      });
    };

    // suppliers
    initAccordion('.vacancies__sidebar-inner', '.btn-drop', '.vacancies__sidebar-inner-droplist');


  })($);
});